import './App.css';
import  {useState} from 'react'
import axios from "axios";
import {
  FormLabel,
  Box,
  Input,
  HStack,
  FormControl,
  Center,

} from "@chakra-ui/react";
import Rad from './button';

const App = () => {
  const [name, setName] = useState('');
  const [idade, setIdade] = useState('');
  const [email, setEmail] = useState('');

  function btnFunction() {
    axios.post('http://localhost:8000/forms', {
      name,
      idade,
      email,

    })
      .then(response => {
        console.log(response);
      })
      .catch(error => {
        console.log(error);
      });
  }

  return (

    <div>
       <form >

      <Center
                as="header"
                h={50}
                w={500}
                bg="HotPink"
                color="white"
                fontWeight="bold"
                fontSize="4xl"
                pb="8"
              >
                Formul√°rio
              </Center>
      <FormControl display="flex" flexDir="column" gap="4">
      <HStack spacing="4">
      <Box w="100%">
      <FormLabel htmlFor="nome">Nome Completo</FormLabel>
      <Input 
         id="nome" 
         onChange={e => setName(e.target.value)}
         />
      </Box>
      </HStack>
      <HStack spacing="4">
              <Box w="100%">
                <FormLabel htmlFor="nasc">Data de Nascimento</FormLabel>
                <Input id="nasc" type="date" />
              </Box>
              <Box w="100%">
                <FormLabel htmlFor="natural">Naturalidade</FormLabel>
                <Input id="natural" />
              </Box>
            </HStack>
            <HStack spacing="4">
              <Box w="100%">
                <FormLabel htmlFor="cel">Celular</FormLabel>
                <Input id="cel" type="number" />
              </Box>
              <Box w="100%">
                <FormLabel htmlFor="Tefone">Telefone</FormLabel>
                <Input id="Tefone" type="number" />
              </Box>
            </HStack>

      </FormControl>




      </form>
      <div>
      <Rad onClick={btnFunction}>Enviar</Rad>

      </div>
    </div>

  );
};

export default App;
